import cv2from cvzone.HandTrackingModule import HandDetectorcap = cv2.VideoCapture(0, cv2.CAP_DSHOW)detector = HandDetector(detectionCon=0.8, maxHands=2)while True:    success, img = cap.read()    hands, img = detector.findHands(img) #no draw    if hands:        hand1 = hands[0]        lmList1 = hand1["lmList"] # List of 21 Landmarks points        bbox1 = hand1["bbox"] # coordinates        centerPoint1 = hand1["center"] # center of the hand        handType1 = hand1["type"] # hand type (left or right hand)        if len(hands)==2:            hand2 = hands[1]            lmList2 = hand2["lmList"]  # List of 21 Landmarks points            bbox2 = hand2["bbox"]  # coordinates            centerPoint2 = hand2["center"]  # center of the hand            handType2 = hand2["type"]            print(handType1, handType2)    cv2.imshow("Image", img)    cv2.waitKey(1)